# Задание 3 - linkedlist
text = ''
output = ''
for i in range(4, len(text) - 4):
    if (text[i - 4].islower() or not text[i - 4].isalpha()) and text[i - 3].isupper() and text[i - 2].isupper() and\
            text[i - 1].isupper() and text[i].islower() and text[i + 1].isupper() and text[i + 2].isupper() and \
            text[i + 3].isupper() and (text[i + 4].islower() or not text[i + 4].isalpha()):
        output += text[i]
print(output)
